import React from 'react';
import '../styles/ScorecardTable.css';

const ScorecardTable = () => {
    const holes = Array.from({ length: 18 }, (_, index) => index + 1);
    const rowTitles = ["Hole", "HCP", "Par", "Adj Par"];

    return (
        <table>
            <thead>
                <tr>
                    <th>{rowTitles[0]}</th>
                    {holes.map(hole => (
                        <th key={hole}>{hole}</th>
                    ))}
                </tr>
            </thead>
            <tbody>
                {rowTitles.slice(1).map((title, rowIndex) => (
                    <tr key={rowIndex}>
                        <td>{title}</td>
                        {holes.map(hole => (
                            <td key={`${rowIndex}-${hole}`}></td>
                        ))}
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default ScorecardTable;
